import React,{Component} from 'react';
import {
    GoogleMap,
    Marker,
    InfoWindow,
    LoadScript,
}from "@react-google-maps/api"


const mapContainerStyle = {
    height: "400px",
    width: "80wh",
}

const center = {
    lat:37.774929,
    lng:-122.419418,
}






class RideMap extends Component{
    render(){
        return(
            <LoadScript 
                googleMapsApiKey="AIzaSyDo0sDqdV6VbGyyvSOMhO7rulT-y4c_ftg"
            >
                <GoogleMap mapContainerStyle={mapContainerStyle} 
                    zoom={8}
                    center={center}
                ></GoogleMap>
            </LoadScript>
            
        )
    }
}



export default RideMap;
